import React from 'react'
const Analysis=({genres})=>{
	if(genres==null){
		return(
		<div>
			<h2>Please enter the song first</h2>
		</div>
	);
	}
	return(
		<div className='center'>
			<h1>Music Genre Analysis</h1>
			<p>Blues:{genres[0]}</p>
			<p>Classical:{genres[1]}</p>
			<p>Country:{genres[2]}</p>
			<p>Disco:{genres[3]}</p>
			<p>Hiphop:{genres[4]}</p>
			<p>Jazz:{genres[5]}</p>
			<p>Metal:{genres[6]}</p>
			<p>Pop:{genres[7]}</p>
			<p>Reggae:{genres[8]}</p>
			<p>Rock:{genres[9]}</p>

		</div>

	);
}

export default Analysis;

